import React from 'react';
import DashboardLayout from '../components/DashboardLayout';

const AdminPage = () => {
  return (
    <DashboardLayout>
      <h2>Admin Dashboard</h2>
      <p>Selamat datang, Admin! Di sini Anda dapat mengelola user, melihat laporan, dll.</p>
    </DashboardLayout>
  );
};

export default AdminPage;
